const animals = ['Dog', 'Cat', 'Rat'];

const Example = () => {
  return (
    <>
      <h3>配列の操作</h3>
      <ul>
        {animals.map(e => {
          return <li>{e}</li>;
        })}
      </ul>
    </>
  );
};

export default Example;
